import "./Menu.css";
import { Link } from "react-router-dom";

function Menu() {
  return (
    <ul className="menu flex">
      <li>
        <Link to="Mascotas en Adopción">Peliculas</Link>
      </li>
      <li>
        <Link to="Mascotas Encontradas">Series</Link>
      </li>
      <li>
        <Link to="Mascotas pérdidas">Premios</Link>
      </li>
      <li>
        <Link to="actores">Actores</Link>
      </li>
    </ul>
  );
}

export default Menu;
